    b = ord('A')
    s = [False] * 255
    res = 1
    for j in range(m):
        for i in range(b, b + 25):
            s[i] = False
        for i in range(n):
            s[ord(names[i][j])] = True
        r = 0
        for i in range(b, b + 26):
            if s[i]:
                r += 1
        res *= r
    return res % mod

